import React from 'react';
import './App.css';

function App() {
  return (
    <div style={styles.container}>
      {/* 상단 네비게이션 바 */}
      <nav style={styles.navbar}>
        <a style={styles.navItem} href="#agents">요원</a>
        <a style={styles.navItem} href="#map-rotation">맵 로테이션</a>
        <a style={styles.navItem} href="#rank">랭크</a>
        <a style={styles.navItem} href="#esports">E-Sports</a>
      </nav>

      {/* 타이틀과 입력창 */}
      <h1 style={styles.title}>INFOV</h1>
      <input
        type="text"
        placeholder="아이디를 입력해주세요 ex.) CU24#편의점"
        style={styles.input}
      />
    </div>
  );
}

const styles = {
  container: {
    height: '100vh',
    backgroundColor: '#0f0f0f',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  navbar: {
    width: '100%',
    display: 'flex',
    justifyContent: 'center',
    padding: '20px 0',
    backgroundColor: '#1a1a1a',
    position: 'fixed',
    top: 0,
    zIndex: 1000,
  },
  navItem: {
    color: '#fff',
    margin: '0 20px',
    textDecoration: 'none',
    fontSize: '18px',
    fontWeight: 'bold',
    cursor: 'pointer',
  },
  title: {
    fontSize: '72px',
    fontWeight: 'bold',
    color: '#ffffff',
    marginTop: '120px', // 네비게이션 바 공간 확보
    marginBottom: '30px',
  },
  input: {
    width: '300px',
    height: '40px',
    fontSize: '16px',
    padding: '0 10px',
    borderRadius: '5px',
    border: 'none',
    outline: 'none',
  },
};

export default App;
